import React from "react";
import "./ProtecaoDigital.css";

const ProtecaoDigital = () => {
  return (
    <div className="protecao-digital-container">
      <div className="protecao-digital-content">
        <h1>Proteja Seu Futuro Digital</h1>
        <p>
          Descubra como podemos ajudar você a navegar com segurança e confiança.
          Dicas, ferramentas e suporte para uma experiência digital protegida.
        </p>
      </div>
    </div>
  );
};

export default ProtecaoDigital;
